import React, { useState } from 'react';
import { View, Text, StyleSheet, TouchableOpacity, Modal, ScrollView } from 'react-native';

const MoodTracker = ({ onMoodUpdate }) => {
  const [modalVisible, setModalVisible] = useState(false);
  const [selectedActivity, setSelectedActivity] = useState(null);
  const [trackedMoods, setTrackedMoods] = useState([]);

  const moods = [
    { value: 1, emoji: 'ðŸ˜–', label: 'Terrible' },
    { value: 2, emoji: 'ðŸ˜”', label: 'Bad' },
    { value: 3, emoji: 'ðŸ˜', label: 'Neutral' },
    { value: 4, emoji: 'ðŸ™‚', label: 'Good' },
    { value: 5, emoji: 'ðŸ˜„', label: 'Great' },
  ];

  // Mock list of recent activities
  const recentActivities = [
    { id: '1', title: 'Morning Workout', category: 'grind' },
    { id: '2', title: 'Team Meeting', category: 'work' },
    { id: '3', title: 'Project Planning', category: 'work' },
    { id: '4', title: 'Lunch Break', category: 'leisure' },
    { id: '5', title: 'Coding Session', category: 'grind' },
  ];

  const handleOpenModal = () => {
    setModalVisible(true);
  };

  const handleSelectActivity = (activity) => {
    setSelectedActivity(activity);
  };

  const handleMoodSelect = (mood) => {
    if (!selectedActivity) return;

    const newMoodEntry = {
      id: Date.now().toString(),
      activityId: selectedActivity.id,
      activityTitle: selectedActivity.title,
      category: selectedActivity.category,
      moodValue: mood.value,
      moodLabel: mood.label,
      moodEmoji: mood.emoji,
      timestamp: new Date().toISOString(),
    };

    const updatedMoods = [...trackedMoods, newMoodEntry];
    setTrackedMoods(updatedMoods);
    onMoodUpdate(updatedMoods);

    // Reset and close modal
    setSelectedActivity(null);
    setModalVisible(false);
  };

  // Calculate average mood if there are tracked moods
  const averageMood = trackedMoods.length 
    ? (trackedMoods.reduce((sum, entry) => sum + entry.moodValue, 0) / trackedMoods.length).toFixed(1)
    : null;

  return (
    <View style={styles.container}>
      <View style={styles.headerContainer}>
        <Text style={styles.title}>Mood Tracker</Text>
        {averageMood && (
          <View style={styles.averageMoodContainer}>
            <Text style={styles.averageLabel}>Today's Average</Text>
            <Text style={styles.averageValue}>{averageMood}/5</Text>
          </View>
        )}
      </View>

      <TouchableOpacity 
        style={styles.trackButton}
        onPress={handleOpenModal}
      >
        <Text style={styles.trackButtonText}>Track Mood After Activity</Text>
      </TouchableOpacity>

      {trackedMoods.length > 0 ? (
        <ScrollView style={styles.moodList}>
          {trackedMoods.map(entry => (
            <View key={entry.id} style={styles.moodEntry}>
              <View style={styles.moodInfo}>
                <Text style={styles.activityTitle}>{entry.activityTitle}</Text>
                <Text style={styles.timestamp}>
                  {new Date(entry.timestamp).toLocaleTimeString([], {hour: '2-digit', minute:'2-digit'})}
                </Text>
              </View>
              <View style={[styles.moodBadge, { backgroundColor: getCategoryColor(entry.category) }]}>
                <Text style={styles.moodEmoji}>{entry.moodEmoji}</Text>
                <Text style={styles.moodLabel}>{entry.moodLabel}</Text>
              </View>
            </View>
          ))}
        </ScrollView>
      ) : (
        <Text style={styles.emptyState}>
          Track your mood after completing activities to see patterns in how they affect you.
        </Text>
      )}

      {/* Modal for selecting activity and mood */}
      <Modal
        animationType="slide"
        transparent={true}
        visible={modalVisible}
        onRequestClose={() => setModalVisible(false)}
      >
        <View style={styles.modalContainer}>
          <View style={styles.modalContent}>
            <Text style={styles.modalTitle}>
              {selectedActivity 
                ? `How did you feel after "${selectedActivity.title}"?`
                : 'Select an Activity'}
            </Text>

            {!selectedActivity ? (
              <ScrollView style={styles.activityList}>
                {recentActivities.map(activity => (
                  <TouchableOpacity
                    key={activity.id}
                    style={[
                      styles.activityItem,
                      { borderLeftColor: getCategoryColor(activity.category) }
                    ]}
                    onPress={() => handleSelectActivity(activity)}
                  >
                    <Text style={styles.activityItemTitle}>{activity.title}</Text>
                    <Text style={styles.activityCategory}>
                      {activity.category.charAt(0).toUpperCase() + activity.category.slice(1)}
                    </Text>
                  </TouchableOpacity>
                ))}
              </ScrollView>
            ) : (
              <View style={styles.moodSelector}>
                {moods.map(mood => (
                  <TouchableOpacity
                    key={mood.value}
                    style={styles.moodOption}
                    onPress={() => handleMoodSelect(mood)}
                  >
                    <Text style={styles.moodEmoji}>{mood.emoji}</Text>
                    <Text style={styles.moodOptionLabel}>{mood.label}</Text>
                  </TouchableOpacity>
                ))}
              </View>
            )}

            <TouchableOpacity
              style={styles.closeButton}
              onPress={() => {
                setSelectedActivity(null);
                setModalVisible(false);
              }}
            >
              <Text style={styles.closeButtonText}>Cancel</Text>
            </TouchableOpacity>
          </View>
        </View>
      </Modal>
    </View>
  );
};

// Helper function to get color based on category
const getCategoryColor = (category) => {
  switch (category) {
    case 'work': return '#3498db';
    case 'leisure': return '#e74c3c';
    case 'grind': return '#2ecc71';
    default: return '#9E9E9E';
  }
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: 'white',
    borderRadius: 12,
    padding: 16,
    marginVertical: 10,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.1,
    shadowRadius: 4,
    elevation: 3,
  },
  headerContainer: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: 15,
  },
  title: {
    fontSize: 18,
    fontWeight: 'bold',
    color: '#333',
  },
  averageMoodContainer: {
    alignItems: 'center',
  },
  averageLabel: {
    fontSize: 12,
    color: '#666',
  },
  averageValue: {
    fontSize: 16,
    fontWeight: 'bold',
    color: '#2ecc71',
  },
  trackButton: {
    backgroundColor: '#9b59b6',
    paddingVertical: 12,
    borderRadius: 6,
    alignItems: 'center',
    marginBottom: 15,
  },
  trackButtonText: {
    color: 'white',
    fontWeight: 'bold',
    fontSize: 16,
  },
  emptyState: {
    fontSize: 14,
    color: '#666',
    fontStyle: 'italic',
    textAlign: 'center',
    marginVertical: 20,
  },
  moodList: {
    maxHeight: 200,
  },
  moodEntry: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    paddingVertical: 10,
    borderBottomWidth: 1,
    borderBottomColor: '#f0f0f0',
  },
  moodInfo: {
    flex: 1,
  },
  activityTitle: {
    fontSize: 16,
    fontWeight: '500',
    color: '#333',
  },
  timestamp: {
    fontSize: 12,
    color: '#999',
    marginTop: 2,
  },
  moodBadge: {
    flexDirection: 'row',
    alignItems: 'center',
    padding: 6,
    borderRadius: 15,
    minWidth: 90,
    justifyContent: 'center',
  },
  moodEmoji: {
    fontSize: 18,
    marginRight: 5,
  },
  moodLabel: {
    color: 'white',
    fontWeight: '600',
    fontSize: 12,
  },

  // Modal styles
  modalContainer: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: 'rgba(0, 0, 0, 0.5)',
  },
  modalContent: {
    backgroundColor: 'white',
    borderRadius: 12,
    padding: 20,
    width: '85%',
    maxHeight: '80%',
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.3,
    shadowRadius: 5,
    elevation: 5,
  },
  modalTitle: {
    fontSize: 18,
    fontWeight: 'bold',
    marginBottom: 15,
    textAlign: 'center',
    color: '#333',
  },
  activityList: {
    marginVertical: 10,
    maxHeight: 300,
  },
  activityItem: {
    padding: 12,
    borderLeftWidth: 4,
    marginBottom: 8,
    backgroundColor: '#f8f8f8',
    borderRadius: 6,
  },
  activityItemTitle: {
    fontSize: 16,
    fontWeight: '500',
    color: '#333',
  },
  activityCategory: {
    fontSize: 12,
    color: '#666',
    marginTop: 3,
  },
  moodSelector: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    justifyContent: 'space-between',
    marginVertical: 15,
  },
  moodOption: {
    width: '30%',
    alignItems: 'center',
    padding: 10,
    marginVertical: 10,
    backgroundColor: '#f8f8f8',
    borderRadius: 8,
  },
  moodOptionLabel: {
    marginTop: 5,
    color: '#333',
    fontWeight: '500',
  },
  closeButton: {
    backgroundColor: '#ddd',
    paddingVertical: 12,
    borderRadius: 6,
    alignItems: 'center',
    marginTop: 15,
  },
  closeButtonText: {
    color: '#333',
    fontWeight: '600',
    fontSize: 16,
  },
});

export default MoodTracker;
